  return (
    <div className="section-item">
      <div>
        <div>{item.Name}</div>
        <div>{item.Description}</div>
      </div>

      <div>${item.Price}</div>
      <div>{/* <ManageCart item={item} /> */}</div>
    </div>
  );
}
